import list from './List'

class personDetails extends Component {


    findPerson = (id) => {
        return list.find((person)=>{
            return person._id === id
        })
    }



    render() {

        let id = this.props.match.params.id; 


        let theCountry = this.findPerson(id)


        return (
            <div className="details">
                <div className="col-7">
                    <h1>{theCountry.name.common}</h1>
                    <table className="table">
                    <thead></thead>
                        <tbody>
                            <tr>
                            <td >Capital</td>
                            <td>{theCountry.capital}</td>
                            </tr>
                            <tr>
                            <td>Area</td>
                            <td>{theCountry.area}
                                <sup>2</sup>
                            </td>
                            </tr>
